			(26,NULL, '2021-11-14 06:00:00',  '2021-11-14 18:00:00', 55, 1, 1, current_timestamp(), current_timestamp(), 'หวยมาเลย์', 2, '<h4>&nbsp;</h4><p><strong>1. ระบบ เปิดรับแทงทุกวัน พุธ ,เสาร์ และ อาทิตย์&nbsp;&nbsp;</strong></p><p><strong>2. ระบบ เปิดรับแทงตั้งแต่เวลา 06:00 น.&nbsp;&nbsp;</strong></p><p><strong>3. ระบบ ปิดรับแทงเวลา 18:00 น.</strong></p><p><strong>ตาราง ราคาจ่ายที่ให้คุณมากกว่าใคร</strong></p><div id="""" class="""" title="""" data-exact-height="""" data-content-padding-horizontal="""" data-content-padding-vertical="""" data-state="""" data-reactid=""""><div id="""" class="""" data-reactid=""""><p>3 ตัวบน ราคาจ่าย 750 บาท</p><p>3 ตัวโต๊ด ราคาจ่าย 120 บาท</p><p>2 ตัวบน &ndash; ล่าง ราคา 90 บาท</p><p>เลขวิ่ง 3 ตัวบน ราคา 3.2 บาท</p><p>เลขวิ่ง 2 ตัวล่าง ราคา 4.2 บาท</p></div></div><div><div id="""" class="""" title="""" data-exact-height="""" data-content-padding-horizontal="""" data-content-padding-vertical="""" data-state="""" data-reactid=""""><div id="""" class="""" data-reactid="""">&nbsp;</div></div><p>&nbsp;</p></div><div>&nbsp;</div><p>&nbsp;</p>', 1),			            						
			(26,NULL, '2021-11-14 06:00:00',  '2021-11-14 09:50:00', 55, 1, 2, current_timestamp(), current_timestamp(), 'หวยหุ้นไทยเช้า', 1, '<h3 class=""""text-center text-danger"""">&nbsp;</h3><hr class=""""m-t-lg"""" /><div><span style=""""color: #000000;"""">ปิดแทงหวยหุ้นไทยเช้า ชั่วคราว</span></div><blockquote><div>&nbsp;</div></blockquote><p><span style=""""color: #000000;"""">เนื่องจากมีสมาชิกบางกลุ่มสามารถทำเลขล็อคผลรางวัลหวยหุ้นไทยได้&nbsp;ซึง</span><br /><span style=""""color: #000000;"""">ได้มีเลขล็อคแบบนี้มานานเป็น 10 ปี และก็มีมาหลากหลายรูปแบบไม่หมดไม่สิ้น&nbsp;</span><br /><span style=""""color: #000000;"""">ทำให้สมาชิกที่ไม่ทราบเรื่อง กลายเป็นต้องเดิมพันด้วยผลรางวัลที่ไม่โปร่งใส</span><br /><span style=""""color: #000000;"""">ไม่ยุติธรรมแก่สมาชิกกลุ่มอื่นๆ&nbsp;</span><br /><span style=""""color: #000000;"""">อีกทั้งทำให้เกิดความเสียหายและเกิดผลเสียกับทางบริษัท&nbsp;ด้วย</span><br /><span style=""""color: #000000;"""">เหตุนี้ทางบริษัทจึงเห็นสมควรถึงความไม่โปร่งใสในการเล่นหวยหุ้นไทย&nbsp;</span><br /><span style=""""color: #000000;"""">ซึงขัดต่อหลักการและนโยบายของบริษัทฯ&nbsp;</span><br /><span style=""""color: #000000;"""">จึงได้ขอทำการปิดรับทายผลหวยหุ้นไทยเป็นการชั่วคราว&nbsp;จึงแจ้งมาเพื่อทราบโดยทั่วกัน&nbsp;ต้องกราบขออภัยในความไม่สะดวก..&nbsp;หากผิดพลาดประการใดต้องขออภัยด้วยครับ ขอบพระคุณครับ</span></p><div>&nbsp;</div><div>&nbsp;</div><div>หากมีการเปลี่ยนแปลง การเปิดรับทายผล จะแจ้งผ่านทางเอเย่นต์ ข่าวสารประชาสัมพันธ์<br />เพื่อให้สมาชิกทุกๆท่านได้รับทราบ&nbsp;<br />และขอขอบพระคุณสมาชิกทุกท่านที่ให้ความไว้วางใจให้เราได้มีส่วนร่วมในทุกๆ<br />การเดิมพันของท่าน&nbsp;หวังเป็นอย่างยิ่งว่าจะได้รับใช้บริการและดูแลสมาชิกที่เคารพทุกๆท่าน อย่างนี้ต่อไป</div><div>&nbsp;</div><div>คำเตือน!&nbsp;สมาชิกทุกๆท่านโปรดระวังมิจฉาชีพหลอกหลวงขายตัวเลขหรือวิธีอื่นๆ&nbsp;<br />โปรดอย่าหลงเชื่อหรือโอนเงิน&nbsp;<br />เพราะอาจะตกเป็นเหยื่อของมิจฉาชีพที่มาหาผลประโยชน์จากจุดนี้&nbsp;</div>', 1),						
			(26,NULL, '2021-11-14 06:00:00',  '2021-11-14 12:15:00', 55, 1, 2, current_timestamp(), current_timestamp(), 'หวยหุ้นไทยเที่ยง', 1, '<div><span style=""""color: #000000;"""">ปิดแทงหวยหุ้นไทยเที่ยง ชั่วคราว</span></div><blockquote><div>&nbsp;</div></blockquote><p><span style=""""color: #000000;"""">เนื่องจากมีสมาชิกบางกลุ่มสามารถทำเลขล็อคผลรางวัลหวยหุ้นไทยได้&nbsp;ซึง</span><br /><span style=""""color: #000000;"""">ได้มีเลขล็อคแบบนี้มานานเป็น 10 ปี และก็มีมาหลากหลายรูปแบบไม่หมดไม่สิ้น&nbsp;</span><br /><span style=""""color: #000000;"""">ทำให้สมาชิกที่ไม่ทราบเรื่อง กลายเป็นต้องเดิมพันด้วยผลรางวัลที่ไม่โปร่งใส</span><br /><span style=""""color: #000000;"""">ไม่ยุติธรรมแก่สมาชิกกลุ่มอื่นๆ&nbsp;</span><br /><span style=""""color: #000000;"""">อีกทั้งทำให้เกิดความเสียหายและเกิดผลเสียกับทางบริษัท&nbsp;ด้วย</span><br /><span style=""""color: #000000;"""">เหตุนี้ทางบริษัทจึงเห็นสมควรถึงความไม่โปร่งใสในการเล่นหวยหุ้นไทย&nbsp;</span><br /><span style=""""color: #000000;"""">ซึงขัดต่อหลักการและนโยบายของบริษัทฯ&nbsp;</span><br /><span style=""""color: #000000;"""">จึงได้ขอทำการปิดรับทายผลหวยหุ้นไทยเป็นการชั่วคราว&nbsp;จึงแจ้งมาเพื่อทราบโดยทั่วกัน&nbsp;ต้องกราบขออภัยในความไม่สะดวก..&nbsp;หากผิดพลาดประการใดต้องขออภัยด้วยครับ ขอบพระคุณครับ</span></p><div>&nbsp;</div><div>&nbsp;</div><div><span style=""""color: #000000;"""">หากมีการเปลี่ยนแปลง การเปิดรับทายผล จะแจ้งผ่านทางเอเย่นต์ ข่าวสารประชาสัมพันธ์</span><br /><span style=""""color: #000000;"""">เพื่อให้สมาชิกทุกๆท่านได้รับทราบ&nbsp;</span><br /><span style=""""color: #000000;"""">และขอขอบพระคุณสมาชิกทุกท่านที่ให้ความไว้วางใจให้เราได้มีส่วนร่วมในทุกๆ</span><br /><span style=""""color: #000000;"""">การเดิมพันของท่าน&nbsp;หวังเป็นอย่างยิ่งว่าจะได้รับใช้บริการและดูแลสมาชิกที่เคารพทุกๆท่าน อย่างนี้ต่อไป</span></div><div>&nbsp;</div><div>คำเตือน!&nbsp;สมาชิกทุกๆท่านโปรดระวังมิจฉาชีพหลอกหลวงขายตัวเลขหรือวิธีอื่นๆ&nbsp;<br />โปรดอย่าหลงเชื่อหรือโอนเงิน&nbsp;<br />เพราะอาจะตกเป็นเหยื่อของมิจฉาชีพที่มาหาผลประโยชน์จากจุดนี้&nbsp;</div>', 1),						
			(26,NULL, '2021-11-14 06:00:00',  '2021-11-14 14:15:00', 55, 1, 2, current_timestamp(), current_timestamp(), 'หวยหุ้นไทยบ่าย', 1, '<div><span style=""""color: #000000;"""">ปิดแทงหวยหุ้นไทยบ่าย ชั่วคราว</span></div><blockquote><div>&nbsp;</div></blockquote><p><span style=""""color: #000000;"""">เนื่องจากมีสมาชิกบางกลุ่มสามารถทำเลขล็อคผลรางวัลหวยหุ้นไทยได้&nbsp;ซึง</span><br /><span style=""""color: #000000;"""">ได้มีเลขล็อคแบบนี้มานานเป็น 10 ปี และก็มีมาหลากหลายรูปแบบไม่หมดไม่สิ้น&nbsp;</span><br /><span style=""""color: #000000;"""">ทำให้สมาชิกที่ไม่ทราบเรื่อง กลายเป็นต้องเดิมพันด้วยผลรางวัลที่ไม่โปร่งใส</span><br /><span style=""""color: #000000;"""">ไม่ยุติธรรมแก่สมาชิกกลุ่มอื่นๆ&nbsp;</span><br /><span style=""""color: #000000;"""">อีกทั้งทำให้เกิดความเสียหายและเกิดผลเสียกับทางบริษัท&nbsp;ด้วย</span><br /><span style=""""color: #000000;"""">เหตุนี้ทางบริษัทจึงเห็นสมควรถึงความไม่โปร่งใสในการเล่นหวยหุ้นไทย&nbsp;</span><br /><span style=""""color: #000000;"""">ซึงขัดต่อหลักการและนโยบายของบริษัทฯ&nbsp;</span><br /><span style=""""color: #000000;"""">จึงได้ขอทำการปิดรับทายผลหวยหุ้นไทยเป็นการชั่วคราว&nbsp;จึงแจ้งมาเพื่อทราบโดยทั่วกัน&nbsp;ต้องกราบขออภัยในความไม่สะดวก..&nbsp;หากผิดพลาดประการใดต้องขออภัยด้วยครับ ขอบพระคุณครับ</span></p><p>&nbsp;</p><p><span style=""""color: #000000;"""">หากมีการเปลี่ยนแปลง การเปิดรับทายผล จะแจ้งผ่านทางเอเย่นต์ ข่าวสารประชาสัมพันธ์</span><br /><span style=""""color: #000000;"""">เพื่อให้สมาชิกทุกๆท่านได้รับทราบ&nbsp;</span><br /><span style=""""color: #000000;"""">และขอขอบพระคุณสมาชิกทุกท่านที่ให้ความไว้วางใจให้เราได้มีส่วนร่วมในทุกๆ</span><br /><span style=""""color: #000000;"""">การเดิมพันของท่าน&nbsp;หวังเป็นอย่างยิ่งว่าจะได้รับใช้บริการและดูแลสมาชิกที่เคารพทุกๆท่าน อย่างนี้ต่อไป</span></p><div>&nbsp;</div><div>คำเตือน!&nbsp;สมาชิกทุกๆท่านโปรดระวังมิจฉาชีพหลอกหลวงขายตัวเลขหรือวิธีอื่นๆ&nbsp;<br />โปรดอย่าหลงเชื่อหรือโอนเงิน&nbsp;<br />เพราะอาจะตกเป็นเหยื่อของมิจฉาชีพที่มาหาผลประโยชน์จากจุดนี้</div>', 1),						
